import './card.styles.css';

const Card = ({ movie }) => {
  const { id, original_title, email } = movie;

  return (
    <div className='card-container'>
      <img
        alt={`movie ${original_title}`}
        src={`https://robohash.org/${id}?set=set2&size=180x180`}
      />
      <h2>{original_title}</h2>
      <p>{email}</p>
    </div>
  );
};

export default Card;
